import React from 'react';

import './tailwind.css';
import Weather from './app_components/weather.component'
function App() {
  return (
    <div className="App">

      <div className='flex justify-between w-screen'>
          <div className='flex w-1/3 justify-start'><h3 className='w-1/2'>Twitter </h3><h3 className='w-1/2'>Instagram</h3></div>
          <h1 className='text-3xl p-4 bg-black text-white w-1/3 font-serif flex justify-center text-bold'>Wearest.</h1>
          <input class="focus:bg-gray-600 border border-gray-300 w-1/3 ml-20 rounded-full my-4 p-2 block text-white" type="text" placeholder="search place"/>
       </div>
     <Weather/>
    </div>
  );
}

export default App;
